import React, { Component } from 'react';
import './desktop.css';

class Option extends Component {	
  	render() {
  	  	return (
  				  <li id="pestana0" status="enable">
  				     <a href="javascript:$W.Desk.Pestana(0,'html');">
  				        <div class="LiIcon"><i class="material-icons">dashboard</i></div>
  				        <div class="LiTitle">DashBoard</div>
  				        <div class="LiDescrip">Indicadores de uso del aplicativo</div>
  				     </a>
  				  </li>  				
			  );
  	}
}

export default OptionMenu
